import React, { useState } from "react";

const UsersList = (props) => {
  const [enteredDate, setEnteredDate] = useState("");
  const [enteredLog, seEnteredLog] = useState("");
  //this is to prevent the default form from submitting
  const addUserHandler = (event) => {
    event.preventDefault();
  };
  return (
    <div className='container-fluid'>
      <div className='card shadow mx-auto' style={{ width: "800px" }}>
        <div className='card-body '>
          <form onSubmit={addUserHandler}>
            <div className='mb-3 d-flex justify-content-center'>
              <label for='' className='form-label'>
                Date:
              </label>
              <input type='date' className='form-control' id='' />
            </div>
            <div className='mb-3 d-flex justify-content-center'>
              <label for='' className='form-label'>
                Log1:
              </label>
              <input type='logs' className='form-control' id='' />
            </div>
            <div className='mb-3 d-flex justify-content-center'>
              <label for='' className='form-label'>
                Log2:
              </label>
              <input type='logs' className='form-control' id='' />
            </div>
            <div className='mb-3 d-flex '>
              <label for='' className='form-label'>
                Log3:
              </label>
              <input type='logs' className='form-control' id='' />
            </div>
            <button justify-content-center></button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default UsersList;
